from django.shortcuts import render
from django.views.generic import View
from django.http import JsonResponse
import time
# Create your views here.

def index(request):
	context = {
	"india" : "data:image/png;base64,",
	"bargraph" : "data:image/png;base64,",
	"piechart" : "data:image/png;base64,"
	}
	return render(request,'trends/index.html',context=context)



class Topic(View):
	def get(self,request):
		topics = ['Hash']*100

		if request.is_ajax():
			time.sleep(2)
			return JsonResponse({'topics':topics},status=200)
		else :
			return render(request, 'trends/topics.html')

class About(View):
	def get(self,request):
		return render(request, 'trends/about.html')
